import React, { Component } from "react";
import { InfoConsumer } from "../context";

class Details extends Component {
    render() {
        return (
            <InfoConsumer>
                {value => {
                    const {
                        id,
                        headerTitle,
                        headerSubTitle,
                        headerText,
                        image,
                        title,
                        maps,
                        description
                    } = data.detailInfo;

                    return (
                        <React.Fragment>
                            <div className="conteiner-fluid align-items-center">
                                <h1 className="display-1 font-weight-bold">
                                    {headerTitle}
                                </h1>
                            </div>
                        </React.Fragment>
                    );
                }}
            </InfoConsumer>
        );
    }
}

export default Details;
